import React from 'react';
import { Redirect } from 'react-router-dom';
import './homePage.css';

const logoutUser = e => {
	this.setState({logout: true});
}

const Home = (props) => (


    <div>
        <nav>
			<ul>
				<li className = "Title">
					NOverdose
				</li>
				<li>
					<a onclick={this.logoutUser}>Logout </a>
				</li>
				<li>
					<a href = "">Search</a>
				</li>
				<li>
				  	<a href = "">Profile</a>
				</li>
				<li>
					<a onClick = {<Redirect to="/login"/>} >Home</a>
				</li>
		  	</ul>
        </nav>
		<h1>Profile Page</h1>
    </div>


);

export default Home;
